"""**Import Data Set and Concat Data Frame**

The dataset used is the original Titanic dataset obtained from Kaggle. It contains data from all the people who took part in the Titanic hundreds of years ago. So, in the dataset I have a target variable or label, namely `Survived`. All other columns or features will be used to determine whether or not the passengers survived the Titanic incident. The training data is used to train my machine learning model. The testing data will later be used to guess the accuracy of my model on Kaggle.

In this step, I will read data from a csv file and concat the dataframe by creating a function.
"""

# Define function `concat_df` to concatenate two datasets from 2 csv into one dataframe
def concat_df(train_data, test_data):
    # Returns a concatenated df of training and test set
    return pd.concat([train_data, test_data], sort=True).reset_index(drop=True)

# Put csv into Pandas dataframe use `pd.read_csv()`
# Training data is entered into `df_train`
df_train = pd.read_csv('https://storage.googleapis.com/dqlab-dataset/challenge/feature-engineering/titanic_train.csv')
#  Testing data is entered into `df_test`
df_test = pd.read_csv('https://storage.googleapis.com/dqlab-dataset/challenge/feature-engineering/titanic_test.csv')
# `df_all` is the concatenation of the two dataframes
df_all = concat_df(df_train, df_test)

# Name each dataframe by providing a name for each dataframe
df_train.name = 'Training Set'
df_test.name = 'Test Set'
df_all.name = 'All Set' 
dfs = [df_train, df_test]

