"""**Fill missing values**

To fill in the missing values in `Age`, since I know that a person's age is related to the class of passenger, I will fill it with the mean ages of someone in that class and based on their gender. So, I will do `groupby()` of gender and class of the passengers, then fill that value into the missing value in the data.
"""

age_by_pclass_sex = df_all.groupby(['Sex', 'Pclass']).median()['Age']

for pclass in range(1, 4):
    for sex in ['female', 'male']:
        print('Median age of Pclass {} {}s: {}'.format(pclass, sex, age_by_pclass_sex[sex][pclass]))
print('Median age of all passengers: {}'.format(df_all['Age'].median()))

# Filling the missing values in Age with the medians of Sex and Pclass groups
df_all['Age'] = df_all.groupby(['Sex', 'Pclass'])['Age'].apply(lambda x: x.fillna(x.median()))

"""I will also fill in the missing values for the `Embarked` and `Fare` columns. For 'Embarked', most people from Titanic depart from Southampton/S, so I can fill it with S only. This is better than leaving the data blank."""

# Filling the missing values in Embarked with S
df_all['Embarked'] = df_all['Embarked'].fillna('S')

"""For `Fare`, I know that `Fare` is closely related to `Passenger Class`, `Number of Parent/Children`, and `Number of Sibling/Spouse`. So I can fill it with the middle value of the people in the group."""

med_fare = df_all.groupby(['Pclass','Parch','SibSp']).Fare.median()[3][0][0]
# Filling the missing value in Fare with the median Fare of 3rd class alone passanger
df_all['Fare'] = df_all['Fare'].fillna(med_fare)

