"""If I look at the `Name` column, the names of people in the dataset have the same pattern, namely: `[Last_Name], [Appellation]. [First_Name]` so that I can just take the appellation by taking the words after "," (comma) and before "." (point). The `.split()` function will divide the sentence into several words with certain keywords, and can be retrieved with index [ ].

Then I take the first index 0 alias so it will get `Mr`. From here I can create a new feature with the name `Title` which contains someone's appellation. The most common appellations here are `Mr`, `Mrs` , and `Miss`. So that I can find out a person's marital status from their appellation.
From there, I can create another new feature, namely `Is_Married`. This feature is if someone has the appellation 'Mrs' , it means she is married. Then I will make the  plot.
"""

df_all['Title'] = df_all['Name'].str.split(', ', expand=True)[1].str.split('.', expand=True)[0]

print(df_all['Title'].unique())

df_all['Is_Married'] = 0
df_all['Is_Married'].loc[df_all['Title'] == 'Mrs'] = 1

print(df_all['Title'].unique())

"""There are a lot of other appellations, and I'm grouping them together in the next step.

`['Miss', 'Mrs','Ms', 'Mlle', 'Lady', 'Mme', 'the Countess', 'Dona']` I will change to *Miss*/*Mrs*/*Ms*.

`['Dr', 'Col', 'Major', 'Jonkheer', 'Capt', 'Sir', 'Don', 'Rev']` becomes *Dr*/*Military*/*Noble*/*Clergy*.
"""

fig, axs = plt.subplots(nrows=2, figsize=(20, 20))
sns.barplot(x=df_all['Title'].value_counts().index, y=df_all['Title'].value_counts().values, ax=axs[0])

