"""To see what has been done in Feature Engineering, I am looking using `head()`."""

df_all.head(5)

"""# Modelling

**Modelling with the New Features**

What I want is to increase the accuracy of the model with Feature Engineering.

The first step, I will divide the dataset back into training and testing data. Then I am going to encode non-numeric data, encoding [0-n] for categorical data. For example the values of `Sex`, will be changed to 0 and 1 of `male` and `female`. Next, I am changing the category feature to one hot, with `OneHotEncoder()`. It generates multiple columns depending on the number of categories.
"""

# Redivide our dataset into training and testing dataset
df_train = df_all.loc[:890]
df_test = df_all.loc[891:]
dfs = [df_train, df_test]

# Encode non-numeric variables
non_numeric_features = ['Embarked', 'Sex', 'Title', 'Family_Size_Grouped', 'Age', 'Fare']

for df in dfs:
    for feature in non_numeric_features:        
        df[feature] = LabelEncoder().fit_transform(df[feature])

# Change the category feature to one hot       
cat_features = ['Pclass', 'Sex', 'Embarked', 'Title', 'Family_Size_Grouped']
encoded_features = []

for df in dfs:
    for feature in cat_features:
        encoded_feat = OneHotEncoder().fit_transform(df[feature].values.reshape(-1, 1)).toarray()
        n = df[feature].nunique()
        cols = ['{}_{}'.format(feature, n) for n in range(1, n + 1)]
        encoded_df = pd.DataFrame(encoded_feat, columns=cols)
        encoded_df.index = df.index
        encoded_features.append(encoded_df)

df_train = pd.concat([df_train, *encoded_features[:5]], axis=1)
df_test = pd.concat([df_test, *encoded_features[5:]], axis=1)

"""The next step, I am dropping the unnecessary columns from the ones I encoded earlier"""

df_all = concat_df(df_train, df_test)
drop_cols = ['Cabin', 'Embarked', 'Family_Size', 'Family_Size_Grouped', 'Survived',
'Name', 'PassengerId', 'Pclass', 'Sex', 'Ticket', 'Title']

df_all.drop(columns=drop_cols, inplace=True)

df_all.head()

"""The next step, I am dividing the data into training sets and testing sets for modeling"""

X_train = StandardScaler().fit_transform(df_train.drop(columns=drop_cols))
y_train = df_train['Survived'].values
X_test = StandardScaler().fit_transform(df_test.drop(columns=drop_cols))

print('X_train shape\t: {}'.format(X_train.shape))
print('y_train shape\t: {}'.format(y_train.shape))
print('X_test shape\t: {}'.format(X_test.shape))

"""I will use SkLearn's RandomForestClassifier and calculate accuracy using `cross_val_score`."""

random_forest = RandomForestClassifier(
    criterion = 'gini', 
    n_estimators = 1100,
    max_depth = 5, 
    min_samples_split = 4, 
    min_samples_leaf = 5, 
    max_features = 'auto', 
    oob_score = True, 
    random_state = 50
    )
random_forest.fit(X_train, y_train)

from sklearn.model_selection import cross_val_score
scores = cross_val_score(random_forest, X_train, y_train, cv=10, scoring = "accuracy")
print("Scores\t\t\t: ", scores)
print("Mean\t\t\t: ", scores.mean())
print("Standard Deviation\t:", scores.std())

"""**Modeling without the new Features**

Now I will be modeling again without including the features that I have created.
"""

